const login = require('fca-unofficial');
const fs = require('fs');

const eventDict = {}; // initialize an empty dictionary object

const appState = JSON.parse(fs.readFileSync('appstate.json', 'utf8'));

login({ appState }, (err, api) => {
  if (err) {
    return console.error(err);
  }

  api.setOptions({ listenEvents: true });

  api.listenMqtt((err, event) => {
    if (err) {
      return console.error(err);
    }

    eventDict[event.messageID] = event; // add the event to the dictionary

    if (event.type === 'message_unsend') {
      const unsentData = eventDict[event.messageID]; // get the event data from the dictionary

      api.sendMessage(unsentData.body, event.threadID, (err, messageInfo) => {
        if (err) {
          return console.error(err);
        }

        console.log(`Resent message with ID ${messageInfo.messageID} to thread ${event.threadID}`);
        delete eventDict[event.messageID]; // remove the event from the dictionary after successfully resending
      });
    }

  });
});

